import cls from "./userstartpage.module.css";
/*
mainPageContainer - unutar njega su svi elementi ekrana koje koristimo
listContainer - unutar njega su liste odjela 
*/
const DUMMY_DATA = [
    {
        id: "m1",
        logo_pic: "./v12_35.png",
        titleOdjel: "Odjel A",
        descOdjel: "Optužbe",
        longDesc: "Ovaj odjel se bavi optuzbama i zahtjevima"
    },
    {
        id: "m2",
        logo_pic: "./v12_36.png",
        titleOdjel: "Odjel B",
        descOdjel: "Uhljebništvo",
        longDesc: "Ovaj odjel se bavi optuzbama i zahtjevima"
    }
];
function UserStartPage() {
  return (
    <div className={cls.mainPageContainer}>
      <div className={cls.titleContainer}>
        <span className={cls.apptitle}>RED U RED </span>
      </div>

      <div className={cls.btnexit}>
        <span className={cls.txtexit}>IZLAZ</span>
      </div>

      <div className={cls.listContainer}>
        <span className={cls.titleOdjeli}>Popis odjela</span>

        <div className={cls.cardcontainer}>
          <div className={cls.logo_pic}></div>

          <span className={cls.titleOdjel}>Odjel A</span>
          <span className={cls.descOdjel}>Optužbe</span>

          <div className={cls.btnlinecontainer}>
            <div className={cls.btnline}></div>
            <span className={cls.btnlinetxt}>STANI U RED</span>
          </div>
        </div>
      </div>
    </div>
  );
}

export default UserStartPage;
